    public int sizeOf(PList<BinomialHeap<Integer>> heapList) {
        int size = 0;
        PList<BinomialHeap<Integer>> current = heapList;
        while (current != null) {
            size++;
            current = PList.getNext(current);
        }
        return size;
    }

    @Test
    public void binomial_heap_link_test() {
        BinomialHeap<Integer> heap1 = new BinomialHeap<>(5, 2, null, lessEq);
        BinomialHeap<Integer> heap2 = new BinomialHeap<>(7, 2, null, lessEq);
        BinomialHeap<Integer> linkedHeap = heap1.link(heap2);
        assertEquals(3, linkedHeap.height);
        assertEquals(7, (int) linkedHeap.key);
        assertEquals(1, sizeOf(linkedHeap.children));
    }


    @Test
    public void binomial_heap_isHeap_test() {
        BinomialHeap<Integer> heap = new BinomialHeap<>(10, 2, null, lessEq);
        assertTrue(heap.isHeap());
    }

    @Test
    public void binomial_queue_push_and_pop_test1() {
        BinomialQueue<Integer> queue = new BinomialQueue<>(lessEq);
        queue.push(5);
        queue.push(10);
        queue.push(3);
        assertEquals(10, (int) queue.pop());
        assertEquals(5, (int) queue.pop());
        assertEquals(3, (int) queue.pop());
    }

