    @Test
    public void binomial_queue_is_empty_test() {
        BinomialQueue<Integer> queue = new BinomialQueue<>(lessEq);
        assertTrue(queue.isEmpty());
        queue.push(5);
        assertFalse(queue.isEmpty());
        queue.pop();
        assertTrue(queue.isEmpty());
    }

    @Test
    public void binomial_queue_isHeap_test() {
        BinomialQueue<Integer> queue = new BinomialQueue<>(lessEq);
        queue.push(5);
        queue.push(10);
        queue.push(3);
        assertTrue(queue.isHeap());
    }

